	eval("module.exports = {\"layout\":\"post\",\"category\":\"conferences\",\"title\":\"Strange Loop 2014\",\"path\":\"/strange-loop-2014/\",\"date\":\"2014-09-14\",\"body\":\"<p>Im attending the my first <a href=\\\"https://thestrangeloop.com/schedule\\\">Strange Loop</a> conference this year in St. Louis, MO. The opportunity is kind of a big deal and I owe it all to\\nthe conference organizers and sponsors for allowing me to attend as a <a href=\\\"https://thestrangeloop.com/attendees/diversity-scholarships\\\">diversity scholar</a>.</p>\\n<p>Ive taken a few glances at the conference schedule and its been hard to decide which topics I want to check out. When I go to conferences, I always have an internal debate on whether I should go to a talk I know nothing about and may not understand or stick to topics I am familiar with and may learn more about.\\nThere are definitely more unfamiliar topics on the schedule this time around, so the next few days will be full of surprises.</p>\\n<p><a href=\\\"https://thestrangeloop.com/sessions/inside-the-wolfram-language\\\">Stephen Wolframs</a> talk is definitely one I wont miss. <a href=\\\"https://thestrangeloop.com/sessions/domstep-audio-synthesis-ai-and-a-javascript-dance-party\\\">DOMStep</a>? If it involves WUBWUBWUB, wobblin, and waiting for beats to drop, Im there.\\nRecommendations have also helped me in choosing on Pete Hunts talk on <a href=\\\"https://thestrangeloop.com/sessions/react-restful-ui-rendering\\\">React</a> and Yodit Stantons <a href=\\\"https://thestrangeloop.com/sessions/the-internet-of-things-in-practice\\\">IoT in Practice</a>.</p>\\n<p>In addition, Im attending the <a href=\\\"https://thestrangeloop.com/preconf-page/powered-by-javascript\\\">Powered by Javascript</a> workshop the Wednesday before Strange Loop begins. Ive been working\\nwith AngularJS, grunt, gulp, and Sass at work for the last 6 or so months topics with those keywords caught my eye on the <a href=\\\"http://www.manning.com/poweredbyjavascript/\\\">lineup</a>.</p>\\n<ul>\\n<li>Joel Kemp - Using Grunt to auto-generate your Gruntfiles</li>\\n<li>Lukas Ruebbelke - AngularJS Application Architecture That Wont Make You Cry</li>\\n<li>Mike Mikowski - Dump Less and SASS: Dynamic CSS Manipulation with JavaScript</li>\\n<li>Josh Powell - Unravelling the Knot - Clean &amp; Testable Client Side Code</li>\\n<li>Ben Vinegar - Next-Gen Tools for Securing your Front-end Code</li>\\n</ul>\\n<p>The next week will be a whirlwind of knowledge and I hope I can capture, digest, and blog about it all in addition to meeting and catching up with friends.\\nTo note: Ill be sharing my hotel room with another ThoughtWorker also named Pamela from one of our Brazilian offices that Ive never met before! Im also excited to see my neighbor, <a href=\\\"https://twitter.com/girlie_mac\\\">Tomomi Imura</a>, on the Powered by Javascript schedule. Im even throwing in a <a href=\\\"https://www.eventbrite.com/e/lambda-ladies-go-bowling-sponsored-by-fastly-tickets-12789332237\\\">little bowling with Lambda Ladies</a>.</p>\\n<p>Are you attending Strange Loop? Tweet at me and lets go to some talks together. :grin:</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2014-09-14-strange-loop/index.md\n ** module id = 533\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2014-09-14-strange-loop/index.md?");

