	eval("module.exports = {\"title\":\"Powered by Java!..script.\",\"date\":\"2014-09-21\",\"layout\":\"post\",\"readNext\":\"/digesting-strange-loop/\",\"path\":\"/pbjs/\",\"body\":\"<p><img src=\\\"./signage.jpg\\\" alt=\\\"Java -- The Future\\\"></p>\\n<p>The <a href=\\\"http://www.manning.com/poweredbyjavascript/\\\">Manning Powered by Javascript</a> workshop was a mini conference of the current state of Javascript.\\nBy the end of the day, it was clear:</p>\\n<blockquote>\\n<p>Javascript can live everywhere today.</p>\\n</blockquote>\\n<p>Dan Shaw (@dshaw) started the day off with an overview of Node.js and its potential to introduce\\nJavascript to every level of an applications tech stack.\\nHe described himself as previously being a <em>mid-tier</em> developer where he primarily worked on\\napplications with a Java back-end and Javascript front-ends.</p>\\n<p>Dan described Javascript as a beauty and a beast because its a approachable language, given that\\nthe cycle time between ideation and realization is very tight, but the time to level-up in proficiency is very long.</p>\\n<p>The meat of Dans talk focused on one of the biggest engineering challenges we face in building web applications: <em>dealing with legacy and monolithic services</em> that are most often written in Java or PHP.</p>\\n<p>My introduction to the Javascript world and web app development has been with Angular serving data from a legacy APIs.\\nDan described this as a big cause of delaying an application launch anywhere from 6 to 24 months. Ive also been witness to the evident slow front-end experience these services cause.</p>\\n<h3>Front-end back-end</h3>\\n<p>What Dan proposes is to build a Node front-end back-end as a middle tier between the legacy monolith to deliver front-end assets.\\nLike most micro-services, this middle tier allows us separate concerns between the front-end and back-end data.\\nGiven that back-end data stores only evolve when the business domain changes, an event that rarely occurs, we have the ability to change the way front-end assets evolve quickly and often.</p>\\n<h3>Reduced context-switching</h3>\\n<p>My eyes lit up when Dan presented this idea, I know the feeling of context-switching between Java and Javascript all too well.\\nAs a new developer in the industry, its hard to focus on honing best practices in an object-oriented language one day and then focusing on learning a new framework and the set of unwritten rules of another language.\\nSwitching contexts makes it difficult to keep track of the skills Im learning on a day to day. Muscle confusion may be beneficial in some cases (#broscience) but, in my opinion, the there should be some time in between switching things up a bit to let things stick.</p>\\n<p>By having Node in more layers of the stack, full-stack developers get a break from frequent context-switching and front-end engineers have the opportunity to contribute to more of the code base.</p>\\n<h3>Putting it into practice</h3>\\n<p>Dans talk set the tone for a lot of what piqued my interest for the rest of the day and several of the Strange Loop sessions I attended.\\nJavascript can live everywhere. I saw many examples where developers have been creating applications that provide a near-native experience on both mobile and desktop.</p>\\n<p>For example: my neighbor, Tomomi Imura (<a href=\\\"https://twitter.com/girlie_mac\\\">@girlie_mac</a>), demo-ed two applications that she created for fun to demonstrate the ability to hook into device APIs to use whats available in the browser.\\nThe first one was <a href=\\\"http://vimeo.com/92208773\\\">Sushi Compass</a> and the second was <a href=\\\"https://github.com/coremob/camera\\\">CoreMob</a>.\\nThe major APIs leveraged among both were the phones camera and GPS, LocalStorage/IndexDB, and File APIs to read and write.\\nAnother exciting example was Jamison Dances (@jergason) use of the Audio APIs to drop some beats and make <a href=\\\"http://youtu.be/QAwbjMdXj-Y\\\">DOMstep</a>.</p>\\n<p>Caching files locally also brought upon the notion of creating web applications without the need for a server.\\n<a href=\\\"http://dreamwriter.io\\\">DreamWriter.io</a>, for example, manages all user interaction with the client (browser) before ever\\nhaving to communicate with a server  and in Robert Feldmans (@rtfeldman) case, the only server he needed to communicate with was Dropbox, a third-party service.\\nThe biggest benefit of these near-native apps is the fact that theres no need to go through an installation process on both mobile and desktop. On desktop, however, Robert Feldman noted that the fluidity of context switching to a web app\\nintroduces a few extra steps, this being tabbing to a browser window and THEN a tab versus a native container.</p>\\n<p>Overall, my impressions of Powered by Javascript were great. It got me thinking of ways microservices can done differently in addition to motivating me to hone my javascript skills to\\nbuild more web applications. There are other sessions that also impressed me during the day, but Ill save those for another post.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2014-09-21-pbjs/index.md\n ** module id = 534\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2014-09-21-pbjs/index.md?");

