	eval("module.exports = {\"title\":\"Digesting Strange Loop\",\"date\":\"2014-09-26\",\"layout\":\"post\",\"path\":\"/digesting-strange-loop/\",\"body\":\"<p>Wow. Wow.</p>\\n<p>Its been a week since Strange Loop and Im still in awe of the\\ngreat speakers and talks from this years conference.</p>\\n<h2>Party!</h2>\\n<p><img src=\\\"./strange_loop_party.jpg\\\" alt=\\\"Party\\\"></p>\\n<p>On top of all the great talks, I also had the opportunity to attend the best conference\\nopening party EVER at the <a href=\\\"http://www.citymuseum.org/\\\">St. Louis City Museum</a>.\\nIm still scratching my head as to whether or not there were any exhibits I missed\\nor if adults running around, crawling through nooks, crannies, tunnels, and attempting\\nto slide on ALL slides found in the building was an exhibit itself.</p>\\n<h2>My Faves</h2>\\n<p>There were many talks that stood out to me and pumped me up about my current work and\\nthe future of the web in general. Some of my other favorites were just fun in general.</p>\\n<p>Thankfully, Strange Loop has already uploaded all of the talks for future reference on YouTube.</p>\\n<h3><a href=\\\"https://www.youtube.com/watch?v=lKXe3HUG2l4\\\">The Mess Were In</a> <em>by Joe Armstrong</em></h3>\\n<p>This was my favorite keynote for the fact that he touched upon being a mindful\\ndeveloper for those coming after me as well as for my future self. The code we write today should\\nhave great usability for those that come along later on to make changes. It should be easy.</p>\\n<h3><a href=\\\"https://www.youtube.com/watch?v=WqV5kqaFRDU\\\">Web Apps without Web Servers</a> <em>by Richard Feldman</em></h3>\\n<p>This talk blew my mind a little. I wasnt sure what to expect but given that microservices tend to be on my mind a lot, I was intrigued.\\nRichard demonstrated how he was able to create a standalone app without the need to spin up a service on his own server and instead utilize\\nstorage on the browser and File APIs for persistence. He made a great case for non-native web-applications in that theres no need for additonal\\ninstallation.</p>\\n<h3><a href=\\\"https://www.youtube.com/watch?v=QAwbjMdXj-Y\\\">DOMStep: Audio Synthesis, AI and a JavaScript Dance Party</a> <em>by Jamison Dance</em></h3>\\n<p>I like the WUBWUBWUB, so the title of this talk quickly caught my eye. I dont see myself using the WebAudio APIs soon. i.e. I dont have any\\npractical uses for them yet, but what Jamison showed was that theres no need to be practical when you can just have fun and mix tunes with recordings\\nsolely generated and handled through the browser.</p>\\n<h3><a href=\\\"https://www.youtube.com/watch?v=IVvHPPcl2TM\\\">React: RESTful UI Rendering</a> <em>by Pete Hunt</em></h3>\\n<p>I loved this talk. Pete talked about the principles of ReactJS and how they aligned with RESTful services. He made an argument that by applying RESTful principles to any\\nproblem domain, we can &quot;<em>fall into the pit of success</em>.&quot;\\nReactJS is a framework that Im motivated to put in to practice sometime in the near future.\\nIts principles make sense to me and given that AngularJS is the only web framework Ive had experience with,\\nI want to see how Reacts abstractions change the way I think about front end development.</p>\\n<h3><a href=\\\"https://www.youtube.com/watch?v=3_zW63dcZB0\\\">Our Shared Joy of Programming</a> <em>by Carin Meier and Sam Aaron</em></h3>\\n<p>Lets teach the kids how to code! Strange Loop ended with an orchestra of bots and beats by Clojure. Carin and Sam made us all see that, despite\\neveryone outside of our industry perceiving us as geeks and dont understand why we get so worked up about programming,\\nwe can still motivate young kids to find passion that drives us.</p>\\n<h3><a href=\\\"https://www.youtube.com/watch?v=0IQlpFWTFbM\\\">You Can be a Kernel Hacker!</a> <em>by Julia Evans</em></h3>\\n<p>I got to see Julia give this talk in March at Stripes Lightning Talks and Pies night. I had no regrets in seeing her speak again.\\nJulias personality is upbeat and high energy making her presentations fun and memorable. You gotta hand it to her for Rick Roll-ing the audience.</p>\\n<h2>Catching up on What I Missed</h2>\\n<p>These talks were trending during the conference and invoked some <a href=\\\"https://en.wikipedia.org/wiki/Fear_of_missing_out\\\">FOMO</a> in me, but theyre up on Youtube so its easy to catch up.</p>\\n<ul>\\n<li><a href=\\\"https://www.youtube.com/watch?v=0CKru5d4GPk\\\">Spreadsheets for developers</a> by Felienne Hermans\\n<ul>\\n<li>Dude. Spreadsheets are code, turing complete, and not just a programming language  live programming and fully functional!</li>\\n</ul>\\n</li>\\n<li><a href=\\\"https://www.youtube.com/watch?v=uwrCQmpZ8Ts\\\">Coder Decoder: Functional Programming Lingo with Pictures</a> by Katie Miller</li>\\n</ul>\\n<h2>Climb So Ill</h2>\\n<p>For every trip I make to a new city, theres usually two questions I ask myself before I go: where can I get good coffee and\\nwill I be able to lift weights?</p>\\n<p><img src=\\\"./climb_so_ill.jpg\\\" alt=\\\"Climb So Ill\\\"></p>\\n<p>Since joining Mission Cliffs in January, Ive started asking myself another question: I wonder if theres a climbing gym close-by?\\nA few days before I headed out to St. Louis, I found <a href=\\\"http://climbsoill.com\\\">Climb So Ill</a>. Apparently So Ill is a reputable climb hold company and that has a flagship gym a mile away from the Peabody Opera house.\\nI dont mind walking, so I was sold on packing my climbing shoes for the trip. I figured others would be interested in joining and I tweeted the idea of climbing after the conference.\\nI was surprised by the response and the fact that the #StrangeLoopClimbCrew made it to Climb So Ill twice!</p>\\n<p>The staff was very inviting and the gym was one of the better ones Ive been to outside of San Francisco. However, I started having\\nsecond thoughts on whether I can really climb 5.10cs and 5.10ds given that routes set by Touchstone feel easy while the ones set by So Ill felt brutal!</p>\\n<p>Im glad to have had that unique bonding experience with other conference attendees. Dont get me wrong, happy-hours are fun, but why not try something new?</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2014-09-26-stl-faves/index.md\n ** module id = 537\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2014-09-26-stl-faves/index.md?");

