	eval("module.exports = {\"layout\":\"post\",\"title\":\"Cafe Fronts: my pet photo project\",\"path\":\"cafe-fronts-photo-project\",\"date\":\"2014-10-12\",\"body\":\"<p>I write this post as Im sitting in front of one of my favorite cafes in San Francisco: <a href=\\\"https://www.frontsf.com/\\\">Front</a>.</p>\\n<p><a href=\\\"http://instagram.com/p/skUDOBJZAI/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10691620_719034001503334_1071223081_a.jpg\\\" alt=\\\"&amp;quot;Front, SF&amp;quot;\\\"></a></p>\\n<p>One of my methods of exploring London was to pick a cafe that had a reputation for good espresso or pour-overs and go!\\nI started noticing that most of these cafes had similar aesthetics or qualities from the outside that made them stand out.\\nMost of them had a minimalistic feel and windows you could peer into to get a sense of the magic that was going inside.</p>\\n<p>So, I started photographing these store fronts, or cafe fronts, to try to capture what I saw as I walked up to another shop. For each entry, I note what I had and whether or not I had it at the cafes or to take-away.\\nNow as I visit other cities, new cafes in San Francisco, or revisit old favorites, I try to capture these moments to keep a photo diary of my never-ending caffeine crawl.</p>\\n<p>With the power of the hash-tag, Ive been keeping a log of these shots with #cafefront on <a href=\\\"http://instagram.com/pmocampo\\\">Instagram</a>.\\nMy goal is to parse my Instagram feeds JSON to keep a aggregation of shots with the hashtag on a separate page as I add new entries, Ive got something rudimentary in node and express but its not the best.</p>\\n<p>For now, here are a few of my shots linked to the original Instagram entry.</p>\\n<h1>London, UK</h1>\\n<p><a href=\\\"http://instagram.com/p/sh0SMfpZFQ/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10611163_816433215063059_79638287_a.jpg\\\" alt=\\\"&amp;quot;Monmout, London&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/shvKh4JZND/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10601719_321413571364982_1620455919_a.jpg\\\" alt=\\\"&amp;quot;Monmout, London&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/shvKh4JZND/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xfa1/t51.2885-15/10684316_728874707160469_593490802_a.jpg\\\" alt=\\\"&amp;quot;Workshop, London&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/sh052qpZGR/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xpa1/t51.2885-15/923768_1469244343362841_888127534_a.jpg\\\" alt=\\\"&amp;quot;Lantana, London&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/sh1FOvJZGf/\\\"><img src=\\\"http://scontent-b.cdninstagram.com/hphotos-xfa1/t51.2885-15/10684337_322818124566450_418082045_a.jpg\\\" alt=\\\"&amp;quot;Tap No. 26, London&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/shvWFxJZNY/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10632142_764318733627288_1280008185_a.jpg\\\" alt=\\\"&amp;quot;Kaffeine, London&amp;quot;\\\"></a></p>\\n<h1>Los Angeles, CA</h1>\\n<p><a href=\\\"http://instagram.com/p/t0PNSHJZLY/\\\"><img src=\\\"http://scontent-b.cdninstagram.com/hphotos-xaf1/t51.2885-15/10623745_281965128677189_860397151_a.jpg\\\" alt=\\\"&amp;quot;G&amp;amp;B LA&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/t0OPejpZJb/\\\"><img src=\\\"http://scontent-b.cdninstagram.com/hphotos-xfa1/t51.2885-15/10707080_662315377209096_1823143977_a.jpg\\\" alt=\\\"&amp;quot;The Classic, LA&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/t0Gxd9JZL-/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xfa1/t51.2885-15/10707158_690639631035168_349767553_a.jpg\\\" alt=\\\"&amp;quot;Blacktop, LA&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/twSrYpJZBZ/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10683873_697292953681070_893426500_a.jpg\\\" alt=\\\"&amp;quot;Groundwork, LA&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/twRtrtJZPj/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xpa1/t51.2885-15/10541891_372989456198570_168068146_a.jpg\\\" alt=\\\"&amp;quot;Blue Bottle, LA&amp;quot;\\\"></a></p>\\n<h1>San Francisco, CA</h1>\\n<p><a href=\\\"http://instagram.com/p/tYHCsfpZAM/\\\"><img src=\\\"http://scontent-b.cdninstagram.com/hphotos-xfp1/t51.2885-15/1724273_1553868304828729_717270249_a.jpg\\\" alt=\\\"&amp;quot;La Stazione, SF&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/tQJieIJZOq/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10706793_1480099418939817_1308469274_a.jpg\\\" alt=\\\"&amp;quot;Piccino, SF&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/sxgS1SJZO9/\\\"><img src=\\\"http://scontent-b.cdninstagram.com/hphotos-xaf1/t51.2885-15/10616856_1539700169581342_1791696095_a.jpg\\\" alt=\\\"&amp;quot;Grand, SF&amp;quot;\\\"></a>\\n<a href=\\\"http://instagram.com/p/skUDOBJZAI/\\\"><img src=\\\"http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10691620_719034001503334_1071223081_a.jpg\\\" alt=\\\"&amp;quot;Front, SF&amp;quot;\\\"></a></p>\\n<h1>St. Louis, MO</h1>\\n<p><a href=\\\"http://instagram.com/p/tRPjRCpZJG/\\\"><img src=\\\"http://scontent-b.cdninstagram.com/hphotos-xaf1/t51.2885-15/10684128_297579343762576_662605453_a.jpg\\\" alt=\\\"&amp;quot;Sump, St. Louis&amp;quot;\\\"></a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2014-10-12-cafe-fronts/index.md\n ** module id = 539\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2014-10-12-cafe-fronts/index.md?");

