	eval("module.exports = {\"layout\":\"post\",\"title\":\"Amused by Jest Unit Testing\",\"categories\":\"technology, testing\",\"path\":\"amused-by-jest\",\"date\":\"2015-04-03\",\"body\":\"<p>About a month ago, Pete (@ph1) and I had a conversation about Javascript testing frameworks and we agreed that theres not one right answer.\\nYou dont have to commit yourself to a magical tool for something as simple as testing, however, a battle of testing frameworks can definitely be had given that there are so many to choose from.</p>\\n<p>I talked a little bit about <a href=\\\"https://facebook.github.io/jest/\\\">Jest</a> and how it seemed to be beneficial in the fact that it takes care of auto-mocking dependencies. The reason I found this beneficial, or at least time saving, was from experience of having to write a lot of boilerplate code in order to mock depencencies with Angular unit testing. So, when you find a testing framework that promises to make test set-up sound easy, theres no reason not to try it out.</p>\\n<p>So, try it out I did, and I dragged another friend, Dan (<a href=\\\"http://twitter.com/dc_minutiae\\\">@dc_minutiae</a>), along. Our goal was to do a deep dive into React.js, the Flux architecture, and best practices with testing so that we could TDD the design of a web application. In retrospect, maybe our undertaking was a lot to learn at once.\\nOne of the goals would be to keep track of a music playlist with files uploaded through the browser. We called our pet project <a href=\\\"https://github.com/dgcoffman/hyperflux/\\\">Hyperflux</a> out of our love for <a href=\\\"http://hypem.com\\\">The Hype Machine</a>.</p>\\n<p>We started out by looking for a boilerplate/scaffold that could fit our needs on <a href=\\\"https://github.com/enaqx/awesome-react#boilerplates\\\">Awesome React</a>.\\nOne of the boilerplates we chose had <a href=\\\"https://github.com/petehunt/node-jsx\\\">node-jsx</a> as a dependency which allows you to require jsx from node. However, we quickly started running into problems when node-jsx appeared in any of the dependency trees for boilerplates we wanted to try. This caused Jests auto-mocking to start losing its luster.</p>\\n<p>The discovery of node-jsx being a troublesome dependency was not an easy one. We discovered that the require.extensions global is being <a href=\\\"https://nodejs.org/api/globals.html#globals_require_extensions\\\">deprecated and no longer supported</a> and this was causing issues off the bat. Running a test that did nothing was not even possible. The workflow for finding dependencies that cause problem with Jest was cumbersome. You can mark npm dependency paths to be unmocked via <a href=\\\"https://facebook.github.io/jest/docs/api.html#config-unmockedmodulepathpatterns-array-string\\\">configuration</a> but it always seems like a treasure hunt to figure out which ones need to be unmocked.</p>\\n<p>Dan and I were also dumbfounded with how slow our tests were running. Over the course of a couple days fighting configuration and writing a handful of tests, we started noticing our test suite was taking more than 10 seconds to complete. <a href=\\\"http://i.imgur.com/3ihmNOo.gif\\\">Wat</a>.</p>\\n<p>After some reflection, we decided that using a boilerplate with a ton of dependencies we may or may not use was not the best choice. These could cause a lot of overhead with script pre-processing if youre <a href=\\\"https://github.com/facebook/jest/issues/116\\\">JSX-transforming non-JSX files</a> in addition to increasing the breadth and depth of the dependency tree for Jests <a href=\\\"https://github.com/facebook/jest/blob/master/src/HasteModuleLoader/HasteModuleLoader.js\\\">HasteModuleLoader</a> to handle.</p>\\n<p>Our Jest config started getting complicated as time went on and it was clear that we had a lot of dev dependencies to be cognizant of to un-mock.</p>\\n<pre class=\\\"terminal\\\">var jestConfig = {\\nrootDir: '.',\\n\\t\\t\\t\\t testPathDirs: ['<rootDir>/src/\\\\_\\\\_tests\\\\_\\\\_/client/'],\\n\\t\\t\\t\\t scriptPreprocessor: \\\"<rootDir>/node\\\\_modules/babel-jest\\\",\\n\\t\\t\\t\\t testFileExtensions: [\\n\\t\\t\\t\\t\\t \\\"es6\\\",\\n\\t\\t\\t\\t \\\"js\\\"\\n\\t\\t\\t\\t ],\\n\\t\\t\\t\\t moduleFileExtensions: [\\n\\t\\t\\t\\t\\t \\\"js\\\",\\n\\t\\t\\t\\t \\\"json\\\",\\n\\t\\t\\t\\t \\\"es6\\\"\\n\\t\\t\\t\\t ],\\n\\t\\t\\t\\t unmockedModulePathPatterns: [\\n\\t\\t\\t\\t\\t \\\"node\\\\_modules/react\\\",\\n\\t\\t\\t\\t \\\"node\\\\_modules/object-assign\\\",\\n\\t\\t\\t\\t \\\"node\\\\_modules/express\\\",\\n\\t\\t\\t\\t \\\"node\\\\_modules/supertest\\\",\\n\\t\\t\\t\\t \\\"node\\\\_modules/chai\\\",\\n\\t\\t\\t\\t \\\"node\\\\_modules/chai-http\\\",\\n\\t\\t\\t\\t \\\"node\\\\_modules/multer\\\"\\n\\t\\t\\t\\t ]};\\n</pre>\\n<p>SuperTest was one dependency that couldnt be used because of Jests version of Jasmine does not support the <a href=\\\"https://github.com/visionmedia/supertest#api\\\">.end()</a> callback that SuperTest needs in order to make assertions. Without it, our tests had no indication of whether they were done or not.</p>\\n<p>:confused:</p>\\n<p>So its clear, sometimes the tools we pick up to use for a job need a little more understanding before they solve our problems. In this case, we struggled more than we had hoped and my first impression of Jest is not the greatest. However, Im always open to trying out new things but in this case, it may have been better to choose boring technology in the Javascript space so that we could get to the meat of learning React + Flux.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2015-04-03-jest/index.md\n ** module id = 540\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2015-04-03-jest/index.md?");

