	eval("module.exports = {\"layout\":\"post\",\"title\":\"Feelin' like a local\",\"categories\":\"general\",\"path\":\"sf-local\",\"date\":\"2015-07-14\",\"body\":\"<p>Sunday, July 12th, marked the two years Ive lived in San Francisco since I completed <a href=\\\"http://www.learninggeneralist.com/2010/08/thoughtworks-university-story-of-our.html\\\">ThoughtWorks University</a> and flew directly here from Bangalore, India.\\nEvery day spent in this beautiful city has been a treat for me. I feel at home but The City never ceases to surprise me with hidden pockets\\nof sights and people. I feel great pleasure in having the opportunity to share these experiences with others.</p>\\n<p>Saturday, I embarked on a <a href=\\\"www.mapmyride.com/routes/view/775845255\\\">bike ride</a> over the Golden Gate Bridge to Sausalito with two new friends from <a href=\\\"https://www.doubleunion.org\\\">Double Union</a>. Both of them are fairly new to The City,\\nso I couldnt hold back from sharing things to note along the route. We started off at <a href=\\\"http://www.lineacaffe.com/\\\">Linea Caffe</a> in the Mission and I quickly realized that I should have planned\\na better place to start that would have access to a bathroom.</p>\\n<blockquote class=\\\"instagram-media\\\" data-instgrm-version=\\\"4\\\"><a href=\\\"https://instagram.com/p/wHBXOUJZKq/\\\"><div style=\\\" background:url(data:image/png;base64,);\\\"></div></a></blockquote>\\nHowever, being able to think of places off the top of my head for a quick bio-break as I sat on a bench sipping espresso \\nwas reassuring that I've explored the shit out of San Francisco. \\n<p>Pro-tip: <a href=\\\"http://www.visitthemarket.com/\\\">The Market</a> on Market St. has a bathroom you can access with code 451.</p>\\n<p>As we rode up Polk St., I had to point out <a href=\\\"http://www.upcidersf.com/\\\">Upcider</a> because of the generally good times Ive had there and the fact that its an ALL CIDER BAR.\\n:beer:</p>\\n<p>We biked along the Marina, past Crissy Field, and took a moment to take selfies at the base of Fort Point.</p>\\n<blockquote class=\\\"instagram-media\\\" data-instgrm-version=\\\"4\\\"><a href=\\\"https://instagram.com/p/5BI572pZMU/?taken-by=pmocampo\\\" target=\\\"_blank\\\"><div style=\\\"background:url(data:image/png;base64,);\\\"></div></a></blockquote>\\nI can never get tired of the Golden Gate Bridge. Biking over it was simply breath-taking. No really, it's windy up there!\\n<p>Im a very goal-oriented woman. I dont exert myself unless motivated by something. There were a few reasons for me wanting to bike over the bridge.</p>\\n<ol>\\n<li>I wanted to prove to myself that I could be a careful and mindful group ride leader for an <a href=\\\"https://www.missionbicycle.com/blog/oversimplified-how-organize-group-ride\\\">organized ride</a>. We were a total of 3 so no big concern in size. There was some blood shed, but no one got severly hurt. :white_check_mark:</li>\\n<li>After riding over the Golden Gate Bridge on a single-speed, I vowed to wait until I had a bike that was more forgiving (i.e. with gears) before trying it again. Riding Celey, my Bianchi, was lovely. :bicyclist:</li>\\n<li>The main <a href=\\\"http://www.heathceramics.com/home/pages/discover-heath/studio-stores/sausalito/\\\">Heath Ceramics</a> location happens to be in Sausalito and they happen to have second-quality pieces at a discount. Needless to say, it was our final destination on the ride. I had nothing planned after that.</li>\\n</ol>\\n<p>Our visit to Heath was also eventful in that we were in time for the morning tour where we learned about the process of slipcast molding, glazing, and firing of the ceramics.</p>\\n<blockquote class=\\\"instagram-media\\\" data-instgrm-version=\\\"4\\\"><a href=\\\"https://instagram.com/p/5BKxUtpZAa/\\\" target=\\\"_blank\\\"><div style=\\\"background:url(data:image/png;base64,);\\\"></div></a></blockquote>\\nI was also generally pleased to learn more about the practices in energy and resource conservation and recycling that go on during the process.\\n<blockquote class=\\\"instagram-media\\\" data-instgrm-version=\\\"4\\\"><a href=\\\"https://instagram.com/p/5BLJOypZBQ/\\\" target=\\\"_blank\\\"><div style=\\\"background:url(data:image/png;base64,);\\\"></div></a></blockquote>\\n<blockquote class=\\\"instagram-media\\\" data-instgrm-version=\\\"4\\\"><a href=\\\"https://instagram.com/p/5BKWhapZPa/\\\" target=\\\"_blank\\\"><div style=\\\"background:url(data:image/png;base64,);\\\"></div></a></blockquote>\\n<p>Ive always lusted over Heath Ceramics pieces, but have always been turned off by the price tags. However, Ive been KonMari-ing my studio after finishing <a href=\\\"http://www.nytimes.com/2014/10/23/garden/home-organization-advice-from-marie-kondo.html\\\">The Life-Changing Magic Of Tidying Up</a> and have wanted to clean out my kitchen-ware in hopes of replacing it with something I am actually proud of.</p>\\n<blockquote class=\\\"instagram-media\\\" data-instgrm-version=\\\"4\\\"><a href=\\\"https://instagram.com/p/5BJpwwJZN4/\\\" target=\\\"_blank\\\"><div style=\\\"background:url(data:image/png;base64,);\\\"></div></a></blockquote>\\nI practiced some extreme restraint in spending less than $100. It definitely helped that the amount of weight I would bear carrying and space in my messenger bag were limited. As soon as I got home, I requested a Shyp courier to come pick up my old dinner-ware and <a href=\\\"http://blog.shyp.com/shyp-goodwill-donation-receipt/\\\" target=\\\"_blank\\\">deliver it to Goodwill</a>.\\n<p>We took it easy heading back home and opt-ed to hop on a ferry back to San Francisco. Lets say I didnt want to risk taking a spill with a bunch of ceramics on my back on the way back.\\nEven the boarding the ferry in Sausulito felt comforting. We were given the permission to skip the tourist with rental bike queue to board with our Clipper cards.</p>\\n<p>Plans for when we arrived at the Ferry Building in San Francisco were up in the air, but they turned out to be eventful in that I discovered how much SoMa has changed in the Howard St. corridor since I stopped using it for my evening commute.</p>\\n<p><a href=\\\"http://www.yelp.com/biz/defenestration-san-francisco\\\">Defenestration</a> is completely gone, but a quick glance from the bike lane made me stop to check out a new art gallery called <a href=\\\"http://alterspace.co/exhibitions/\\\">Alter Space</a>. While I was browsing, a woman walked in with\\nan iced coffee and with each sip described how it was different. An iced cafe tonic, which she described as a sparkly coffee soda. I was really surprised when she said she got it next door, beacause I had no recollection of there being a coffee shop next to where we were apart from Rituals roastery on 1050 Howard.</p>\\n<blockquote class=\\\"instagram-media\\\" data-instgrm-version=\\\"4\\\"><a href=\\\"https://instagram.com/p/5BLdf0pZB8/\\\" target=\\\"_blank\\\"><div style=\\\"background:url(data:image/png;base64,);\\\"></div></a></blockquote>\\nWe walked outside and then stood in front of vive la tarte and were so impressed with the space that we couldn't resist walking in. Lofty high ceilings, natural lighting, and plenty of seating welcomed us into the new bakery and coffee bar. As we browsed their pastry selections, I heard my name and turned to see a friendly face wave at me. I've made a few barista friends from my multiple coffee shop adventures, and this one in particular worked at <a href=\\\"http://4sq.com/RtLigs\\\" target=\\\"_blank\\\">Front Cafe</a>, where I would stop every weekday morning to grab a cappuccino before taking a Caltrain to Palo Alto. It was great to run into him again after moving on to a different project wiht a different morning commute and getting to learn about <a href=\\\"http://4sq.com/1jmrJWD\\\" target=\\\"_blank\\\">where he's working now</a>. He mentioned the pressure of the additional responsibilities that come with the job but we recognized the opportunities they provide for his career's growth. :raised_hands:\\n<p>The iced cafe tonic <em>is different</em>. It was a refreshing pick-me-up after a hot day in San Francisco for the citys standards.</p>\\n<p>My new friends and I hit the road again towards the Mission and couldnt help but stop to give each other hugs when we reached an intersection where we would be going our separate ways.\\nThey thanked me for the planned ride over the bridge and the serendipitous afternoon.</p>\\n<p>Feels great to inspire others to explore more of the city and it reminds me to not take my residency for granted. SF I :heart: you.</p>\\n<script async defer src=\\\"//platform.instagram.com/en_US/embeds.js\\\"></script>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2015-07-14-feelin-like-a-local/index.md\n ** module id = 542\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2015-07-14-feelin-like-a-local/index.md?");

