	eval("module.exports = {\"layout\":\"post\",\"title\":\"Multi-dimensional Racial Issues\",\"path\":\"black-virgins\",\"date\":\"2015-07-19\",\"body\":\"<p>Last night, I experienced a sensational solo-performance for the first time at <a href=\\\"http://themarsh.org/\\\">The Marsh</a> theater in the Mission.\\nI had walked by the entrance the week before and was intrigued by a poster for <a href=\\\"http://www.virginhipster.com/\\\">Black Virgins are Not For Hipsters</a>\\nand thought it may be worth checking out. After a couple of recommendations from friends and hearing that the performance had been\\nextended until September, there was no question in buying a ticket.</p>\\n<p>In an <a href=\\\"http://www.sfgate.com/performance/article/Black-Virgins-Are-Not-for-Hipsters-1-woman-6232262.php\\\">interview with SFGate</a>,\\nthe actress, Echo Brown, describes her show well in that it gives people a healthy dose of humor while introducing heavy topics and subjects\\nin a different and surprising way in regards to common stereotypes about black women.</p>\\n<blockquote class=\\\"instagram-media\\\" data-instgrm-version=\\\"4\\\"><a href=\\\"https://instagram.com/p/5TqP5tJZNw/\\\" target=\\\"_blank\\\"><div style=\\\" background:url(data:image/png;base64,);\\\"></div></a></blockquote>\\nAfter the show, Echo answered questions and hoped that the biggest message the audience should come away with was \\nthe understanding of multi-dimensionality of black humanity.\\n<p>The play was a heavy and honest emotional roller-coaster, there were moments where I couldnt stop laughing out loud, such as one where Echo claimed:</p>\\n<blockquote>\\n<p>Dancing is the only place where racial stereo-types are A-OK. :thumbsup:</p>\\n</blockquote>\\n<p>Others gave some revelation and really dug deep into memories Ive come to experience in the past as a minority.\\nThe play was not an attack at what one would think of as a <a href=\\\"http://www.maxim.com/style/article/beyond-lumbersexual\\\">lumbersexual hipster</a>, which Echo confessed are usually</p>\\n<blockquote>\\n<p>well intentioned, but blissfully unaware of their biases and privilege.</p>\\n</blockquote>\\n<p>The play reminded me that inferiority within races is very real.\\nIt revealed that lighter-skinned, straighter hair, and European features are what are inexplicably coveted in black women. Society perpetuates this by idolizing Beyonce as a strong black woman.</p>\\n<p>Echo is puzzled by this because</p>\\n<blockquote>\\n<p>The avatar of black woman-hood in America looks like a tan white woman. Light-skinned, European features, and blonde hair.</p>\\n</blockquote>\\n<p>The theme of gender discrimination was also saddening to me in scenes where Echo described herself as not wanted but fuck-able after being harassed by men of equal color for her\\ndarker skin, big nose, and wide face. How could this be a perpetual problem when black men are fighting for their own humanity in the rest of society?</p>\\n<p>Echos performance was a reminder for me that, like her, Im lucky in being able to escape from toxic communities that trap others from finding the avenues for higher education.</p>\\n<p>The audience praised Echos success but she grounded us by reminding us to get caught up in the hype of success. At the end of the day, when we go home (to a cat, in her case), the only thing that is real is ourselves.</p>\\n<script async defer src=\\\"//platform.instagram.com/en_US/embeds.js\\\"></script>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2015-07-19-multi-dimensional-racial-issues/index.md\n ** module id = 543\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2015-07-19-multi-dimensional-racial-issues/index.md?");

