	eval("module.exports = {\"layout\":\"post\",\"title\":\"Hello from Pune\",\"categories\":\"general, travel, TWU\",\"path\":\"hello-from-pune\",\"date\":\"2015-08-13\",\"body\":\"<p>Hola! Im at <a href=\\\"http://info.thoughtworks.com/graduates\\\">ThoughtWorks University</a> in Pune, India as a trainer preparing for our graduates sessions beginning tomorrow. I am writing this to have an artifact to go back to and reflect on how I change over the course of training 2 batches of grads.</p>\\n<p>I learned a little bit more about myself the other day when I participated in a &quot;team discovery&quot;\\nexercise with the other trainers on my team and discussed our strengths, how we thrive,\\nhow we react under pressure, and how we want to develop and putting these attributes in the context of TWU.</p>\\n<p>There was a mention of TWU being a buzz-noisy environment 99% of the time where\\nyou are constantly context switching and interacting with others.</p>\\n<p>This gave me a mini-panic attack. Additionally, my teammates and I, despite being from all over the world,\\nsomehow turned out to lean towards introverted personalities.\\nWhat does this mean for all of us? How will we support each other during a highly interactive program?</p>\\n<p>One of the areas in I want to develop are public speaking with confidence because\\nIve gotten feedback that I tend to take a laid back tone when I do speak in front of a group.\\nThis has been taken as not being excited, believing, or passionate in what Im speaking about. Oops.</p>\\n<p>Another one is being an effective role model. Ive been given so many opportunities to be where\\nI am today. I am constantly surrounded by role models and I have the opportunity to learn\\nand grow from them. I realize that I am in the position to pay it forward.</p>\\n<p>Emotional intelligence is something I am interested in being more intuitive about.\\nI feel that I have a pretty good grasp over my own emotions when I am alone, but when it comes to interacting with others and delivering\\nhonest feedback that may be difficult to give, I choke. Throw in the melting pot of different cultures that is TWU and Im realizing that Im in for an interesting adventure.</p>\\n<p>So how do I thrive? Pairing or working in small, intimate groups. Even in social settings, Id rather go to dinner with a group of no more than 4.\\nI get a lot of satisfaction from being able to clarify things to my teammates when there are knowledge gaps in our understanding of a concept.\\nThis may also be detrimental to my team as well. I get so caught up in solving a problem for others that I end up spoon feeding too soon.</p>\\n<p>Under pressure, I like to think that I withhold from jumping the gun and taking action by stepping away, taking a big breath, and identifying\\nall the building blocks that we need and blockers we need to overcome in order to succeed. Im not afraid to take lead, but if someone else\\nis willing to do it first, I step out of the way and let that person guide us first.\\nIdeally, Id rather take lead with another person (yay pairing!).</p>\\n<p>Am I really an introvert? I dont know.\\nTwo different personality tests tell me something different:</p>\\n<ul>\\n<li>E(xtroverted) S(ensing) T(hinking) J(udging) from <a href=\\\"http://www.humanmetrics.com/cgi-win/jtypes2.asp\\\">Jungs Topology Test</a></li>\\n<li>I(ntroverted) S(ensing) T(hinking) J(udging) from <a href=\\\"http://www.personalitypathways.com/type_inventory.html\\\">Myers Briggs</a></li>\\n</ul>\\n<p>I can feel lonely in crowds, but from experience of living in NYC, wandering London, Hong Kong, Mumbai, etc., this doesnt bother me.\\nId rather recharge alone in crowds rather than sit in my room.\\nThe block of time I spend in the gym is what I need to help me feel grounded.\\nWhich is why Im primarily anti-social during that block of time.</p>\\n<p>So, how do I maximize my opportunity to be a trainer at TWU to develop in these senses?\\nOnly time will tell, excited to come back to this to see how Ive grown and changed.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2015-08-13-hello-from-pune/index.md\n ** module id = 544\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2015-08-13-hello-from-pune/index.md?");

