	eval("module.exports = {\"layout\":\"post\",\"title\":\"The Look of Confusion\",\"categories\":\"general, travel, TWU\",\"path\":\"look-of-confusion\",\"date\":\"2015-08-27\",\"body\":\"<p>That look of confusion on your face is what tells me Ive failed.\\nI got a lot of confused looks this week from several of my grads and I am crushed. :sob:\\nIts a revealing experience to feel how an individuals body language can affect me while Im presenting to an audience. Ive already apologized to my TWU trainers from 2 years ago for all the times I looked bored and sleepy. :joy:</p>\\n<p>The goal was to present a technical concept that I found confusing when I started off as a\\ndeveloper. I hoped that the exercise of teaching it to a class would help me really nail it\\ndown, and it has. However, I dont think I have learned it in a way that I can teach it to a\\nnewbie like I once was.</p>\\n<blockquote>\\n<p>The more I learn, the less I know.</p>\\n</blockquote>\\n<p>We do a lot of code dojos during TWU to exercise these new concepts and to get particular\\nlearning objectives across, but its difficult to achieve that when you look around the room\\nand the group does not even know where to begin. A lot of them seem to be having difficulty in\\nmaking the transition of understanding the concept we present to them to implementation.</p>\\n<p>I am really struggling with the overwhelmed looks on many of their faces. They are\\nbeginning to realize that they dont know as much as they thought they did. I have a huge\\nladle I wish I could feed them with, but that will only hamper their learning journey.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2015-08-27-look-of-confusion/index.md\n ** module id = 545\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2015-08-27-look-of-confusion/index.md?");

