	eval("module.exports = {\"layout\":\"post\",\"title\":\"Don Sergio is looking out for me\",\"categories\":\"general, travel\",\"path\":\"/don-sergio/\",\"date\":\"2015-11-16\",\"body\":\"<p>Don Sergio is a Porteo from Valparaiso that makes a little money from his homes door by selling alfajores and empanadas artesanales. My first experience\\nwith Don Sergio was during a graffiti tour around Valpo that neared its end at Pasaje Bavestrello (a passageway between hilly streets). As we walked down the steps we saw a crowed of other tourists\\nstanding at the inconspicuous door midway with a small wooden sign hanging above. It reads: Alfajores Artesanales $200 c/u.</p>\\n<blockquote>\\n<p>Is that the shop that sells the chocolate covered biscuits with caramel in the middle?</p>\\n</blockquote>\\n<p>an Australian woman in my group said.</p>\\n<blockquote>\\n<p>Yea and theyre only $200 ($0.30 USD).</p>\\n</blockquote>\\n<p>another man replied.</p>\\n<blockquote class=\\\"instagram-media\\\" data-instgrm-version=\\\"5\\\"><a href=\\\"https://instagram.com/p/-DJln6pZHj/\\\"><div style=\\\" background:url(data:image/png;base64,); display:block; height:44px; margin:0 auto -44px; position:relative; top:-22px; width:44px;\\\"></div></a></blockquote>\\n<p>My reaction: WAT. A tasty dessert to end the two hours of walking we did around Cerro Alegre and Cerro Concepcion to learn more about Valpos graffiti artists and collaborations.\\nI noticed Don Sergio also carried empanadas and saw some of my tour-mates buy a few. I had just had lunch before the tour started but my appetite could stomach one.\\nAs we continued down the Pasaje, I had second thoughts and started to climb back up to make the second purchase, but the door was closed! Oh well.</p>\\n<p>The next day I took a more historical tour around Valpo and midway through the tour, where did we end up? Don Sergios door! The tour guide introduced us to Don Sergio and he treated us to an\\nalfajore as a tour treat. The house rules were also explained. Don Sergio is always home, you just have to ring his bell and hell open up for business.</p>\\n<p>I wish Id known that the day before!</p>\\n<p>It wasnt quite lunch time and I had plans to check out a market for some fresh seafood later that day so I held off temptation to buy an empanada, I would plan to eat one for dinner instead.</p>\\n<p>The house rules failed me,  I went to Don Sergios door too late into the night. After the third unanswered bell, I walked away.\\nHowever, I was determined to have one of Don Sergios before I left Valpo. The hostel I was staying in was conveniently up the street from Don Sergios door, so after checking out, I lugged my stuff over to Pasaje Bavestrello and rang the bell.</p>\\n<p>Success, Don Sergio came to the door and offered me his daily menu:</p>\\n<blockquote>\\n<p>Alfajores, empanadas de pino (beef) o salmon y queso.</p>\\n</blockquote>\\n<blockquote>\\n<p>Cual me recomienda? <em>Which one do you recommend?</em></p>\\n</blockquote>\\n<blockquote>\\n<p>Salmon y queso.</p>\\n</blockquote>\\n<blockquote>\\n<p>Ok, una de salmon y queso.</p>\\n</blockquote>\\n<p>Don Sergio went away for a second and then came back out with a warm empanada. $1200 ($1.80 USD).</p>\\n<blockquote>\\n<p>Esa es la que le gusta a los gringos <em>Thats the one white people like.</em></p>\\n</blockquote>\\n<p>Wat. Don Sergio, why would you recommend that one to ME?? :P</p>\\n<p>Don Sergio noticed my duffel bag and trekking pack and asked where I was headed.</p>\\n<blockquote>\\n<p>Santiago, a la estacion de autobuses. <em>To Santiago, via the bus station.</em></p>\\n</blockquote>\\n<p>Don Sergio put his index finger to his eye and then pointed down to my stuff.</p>\\n<blockquote>\\n<p>Tenga mucho cuidado, pele los ojos. <em>Be careful, keep your eyes open.</em></p>\\n</blockquote>\\n<p>As I stood in the sun-light biting into the chewy dough to devour the flaked salmon enveloped in a cheesy glob, a tour neared the bottom of the stairs.\\nThe tour guide began her introduction to Don Sergios shop and the house rules.\\nI signaled to him that he would be having some customers soon. He nodded and closed the door to get ready for the group welcoming.</p>\\n<p>Thanks for looking out for me, Don Sergio, and thank you for the tasty last meal in Valparaiso.</p>\\n<script async defer src=\\\"//platform.instagram.com/en_US/embeds.js\\\"></script>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2015-11-16-don-sergio/index.md\n ** module id = 554\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2015-11-16-don-sergio/index.md?");

