	eval("module.exports = {\"layout\":\"post\",\"title\":\"Street Photography in the Mission\",\"date\":\"2016-03-07\",\"path\":\"/mission-street-photography/\",\"body\":\"<p>Street photography has always been an activity that I approach with hesitation.\\nI live in a city where the minutiae to some delights me.\\nBasically, there is a lot of people watching one can do.</p>\\n<p>I call the Mission District home and the inhabitants and their lifestyles of\\nthe neighborhood vary from one block to the next.</p>\\n<p>Ive always been a timid photographer, but love to capture others in their day to day.\\nBeing caught as one might say by the person being photographed is my biggest fear as it would\\nchange the persons behavior into something less natural, and, to me, less interesting.</p>\\n<p><img src=\\\"./glide.jpg\\\" alt=\\\"Glide\\\"></p>\\n<p>Skill-sharing, workshops, photowalks, etc. in San Francisco are abundant and I feel lucky to have\\nbe able to learn from others. I joined <a href=\\\"http://www.eventbrite.com/o/david-coleman-photography-7965502924\\\">David Coleman</a> and a few others on a 3 hour street photography workshop\\nwhere I came away with a few tidbits of information that I hope to incorporate into my practice.</p>\\n<p>The workshop was balanced between technical and intentional techniques that one can do to aid in venturing out in to the streets. The murals in the Mission Districts Balmy Alley was our playground for the morning.</p>\\n<p><img src=\\\"./balmy.jpg\\\" alt=\\\"balmy alley\\\"></p>\\n<p>One of the biggest takeaways I got from the session was not technical in nature: capture a streetscape with the intent of composing a narrative with images.</p>\\n<p><img src=\\\"./selfie.jpg\\\" alt=\\\"selfie in the alley\\\"></p>\\n<p>David further instructed us on focusing to capture a thematic body of work through a series of images rather than just one perfect shot.\\nMore importantly, the complete narrative is 90% story and technical aspects only really play a part in the 10%. We learned a lot about capturing gestures and how a gesture can create a landscape for a story.</p>\\n<p><img src=\\\"./mariachi.jpg\\\" alt=\\\"Estoy con la Banda\\\"></p>\\n<p>David also gave us a few tips for staying low profile in public.\\nThe most unique of them all was covering the logos and any flashy brand inscriptions on the camera with black electrical tape! Other tips to note were dressing in cool tones and muted colors to call less attention to yourself and reducing the amount of swing needed to bring the viewfinder up to your eyes to take a shot.</p>\\n<p>On the technical side of things, we were recommended to</p>\\n<ul>\\n<li>stay within 21mm to 50mm focal range, basically wide angle lens.</li>\\n<li>shoot in aperture or manual mode</li>\\n<li>begin at a minimum 5.6 F-stop and increase up to F11 as the sun comes out (we had an overcast start to the morning).</li>\\n<li>set the shutter speed to 1/250th of a second in order to freeze motion and go up as needed</li>\\n<li>use Auto ISO at 200</li>\\n</ul>\\n<p>Another concept I had never heard of was <a href=\\\"http://inmybag.net/learn-to-zone-focus/\\\">zone-focusing</a> wherein one gauges the distance between the lens and potential subjects and adjusts focus manually and leave set and ready for someone or something to step into the kill zone. A good zone is usually optically 1/3 of the way between you and a wall. This is to avoid wasting time allowing the camera auto-focusing given that your depth of field within the space is predictable. This article explains things further.</p>\\n<p><img src=\\\"./bart.jpg\\\" alt=\\\"BART\\\"></p>\\n<p>During the remainder of the session we walked around taking shots and incorporating these things in mind and then reconvened at <a href=\\\"http://4sq.com/8KFzOk\\\">Gracias Madre</a> for vegan Mexican food. The pozole rojo was as delicious and reminiscent of what I would enjoy with my family.</p>\\n<p><img src=\\\"./pozole.jpg\\\" alt=\\\"pozole rojo at gracias madre\\\"></p>\\n<p>Some other nuggets of knowledge were</p>\\n<ul>\\n<li>Ask for forgiveness rather than for permission when taking someones photo. Asking first changes behavior.</li>\\n<li>The palm of your hand is 18% reflective and can be substituted for a <a href=\\\"http://petapixel.com/2012/06/06/use-your-hand-as-a-makeshift-gray-card-for-estimating-exposure/\\\">grey card in a pinch when estimating exposure</a>.</li>\\n<li>Shooting someones stride is best when their front foot is pointing up as it captures a subject moving forward in motion rather than the strike of their heel.</li>\\n<li>Formatting SD cards on the camera just re-writes the index file on the card and doesnt actually format the card at all. Its best to format on your computer using <a href=\\\"https://www.sdcard.org/downloads/formatter_4/\\\">SD Formatter</a>.</li>\\n</ul>\\n<p>I am happy to have learned a lot and looking forward to practicing photography on the street no matter where I happen to be.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./2016-03-07-street-photography/index.md\n ** module id = 558\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./2016-03-07-street-photography/index.md?");

